script: |
  super -f text -I q1352.spq | sort > q1352.out

inputs:
  - name: q1352.spq
    data: |
      SELECT DISTINCT + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 NOT IN ( + ( + col1 ) * - col1 + col0 - - - 62 * - col1 + - col2 + - col2 / + col0 * col2, col2, 17 - CAST ( - - col0 AS INTEGER ), - col1 );
  - name: tab0

outputs:
  - name: q1352.out
    data: |
